import React from 'react';
import './Tab4.css';
import DarkModeToggle from '../components/variables/DarkModeToggle';
import { IonMenu, IonHeader, IonToolbar, IonTitle, IonContent, IonItem, IonList } from '@ionic/react';

const Tab4: React.FC = () => {
  return (
    <IonMenu side="start" menuId="first">
        <IonHeader>
            <IonToolbar color="primary">
                <IonTitle>Settings</IonTitle>
            </IonToolbar>
        </IonHeader>
        <IonContent>
            <IonList>
                <IonItem>
                    <DarkModeToggle></DarkModeToggle>
                </IonItem>
            </IonList>
        </IonContent>
    </IonMenu>
  );
};

export default Tab4;
